style.css:
@-moz-document domain("nationen.ebcomments.dk"), domain("eb.dk"), url-prefix("https://ekstrabladet.dk") {
/* coloring */
    body,
    #fnSearchField
        {background-color:#252525!important}
    
    * {
        text-decoration:        none!important;
        outline:                none!important;
        color:                  #fff !important;
        --color--bruger:        #000 !important;
        --color--white:         #252525!important;
        --color-yellow:         #252525!important;
        --color--black:         #252525!important;
        --color--sport:         #252525!important;
        --color--list:          #252525!important;
        --color--nyheder:       #252525!important;
        --color--yellowlight:   #252525!important;
        --color--graa5:         #252525!important;
        --color--graa6:         #252525!important;
        --color--underholdning: #252525!important;
        --color--breaking:      #252525!important;
        --color--forbrug:       #252525!important;
        --color--sex-samliv:    #252525!important;
        --color--leder:         #252525!important;
        --color--default:       #252525!important;
        --color--eb:            #252525!important;
    }
    
    .dre-item--skin-white,
    .dre-item--skin-black,
    .dre-item--skin-yellow,
    .dre-item--skin-orange,
    .dre-item--skin-green,
    .dre-item--skin-turquoise,
    .dre-item--skin-purple,
    .dre-item--skin-bordeaux,
    .dre-item--skin-blue,
    .dre-item--skin-darkblue,
    .dre-item--skin-red,
    .dre-item--skin-native-light,
    .dre-item--skin-native-dark,
    .dre-item--skin-native-sand,
    .dre-item--skin-native-red,
    .dre-item--skin-native-darkred,
    .dre-item--skin-native-lightred,
    .dre-item--skin-native-green,
    .dre-item--skin-native-darkgreen,
    .dre-item--skin-native-yellow,
    .dre-item--skin-dagsorden
        {background-color:#252525!important;color:#fff!important;--text-highlight-color: #fff !important;}

    /* removal */
    .bodytext-item,.body--payflow,
    #ebbanner_megaboard_artikel,
    #ebbanner_megaboard_dynamisk1,
    #ebbanner_megaboard_dynamisk2,
    #ebbanner_megaboard_dynamisk3,
    #ebbanner_megaboard_dynamisk4,
    #ebbanner_megaboard_dynamisk5,
    #ebbanner_megaboard_dynamisk6,
    #ebbanner_megaboard_dynamisk7,
    #ebbanner_megaboard_dynamisk8,
    #ebbanner_megaboard_dynamisk9,
    #ebbanner_wrapper_megaboard_top,
    .sidebanner-container
        {display:none!important}
    
    /* improvements */
    .sidebanners-content{padding-top: 5px}
    .sidebanners {margin-left: unset}
    .article-bodytext::after {background:unset!important}
}
